import React from 'react';
import './App.css';
import Roster from "./components/roster";
import ReactCalendar from "./components/ReactCalendar";

function App() {
  return (
      <body>
      <div className="leftside">
          <div className="search">

              <p>Add Classes</p>

          </div>

          <div className="roster">

              <p>Class Roster</p>
              <Roster/>

          </div>

      </div>

      <ReactCalendar/>

      </body>
  );
}

export default App;
